// Experience.jsx
export function Experience() {
  return (
    <section className="p-8 max-w-4xl mx-auto" data-aos="fade-up">
      <h2 className="text-4xl font-bold mb-4 border-b-4 border-indigo-500 inline-block">Experience & Volunteering</h2>
      <ul className="space-y-4 mt-6">
        <li><strong>AI Intern</strong> – Infosys Springboard: Built a Voice-Based Patient Call System (React Native).</li>
        <li><strong>Intern</strong> – Microsoft FRT Internship: Learned Azure cloud & security (Jan–Apr 2023).</li>
        <li><strong>GDSC Lead</strong> – Google Developer Student Clubs AMU: Ran hackathons & workshops (2023–2024).</li>
        <li><strong>Secretary</strong> – Computer Science Society: Organized coding events and CS workshops.</li>
      </ul>
    </section>
  );
}
